import { View, Text, TouchableOpacity, Image } from "react-native"

export function Home() {
    return (
        <View>
            <Image
                style={{width: "100px", height: "200px"}}
                source={require('src/Componentes/homePage/homebg.png')}
            />
            <Image source={require('./my-icon.png')} />
        </View>
    )
}
